INSERT INTO `article` VALUES (6, '开发去哪儿网App', '课程跟随Vue版本迭代升级，结合理论与项目带你掌握Vue开发的基础知识与开发技巧', '从Vue基础语法入手，逐层递进，实战项目贴近企业流程，完全按照企业级别代码质量和工程开发流程进行授课，让你理解这套技术在企业中被使用的真实流程。更好的掌握Vue各个基础知识点。\n', 'data:image/jpeg;base64,', '2020-06-23 10:10:23');
INSERT INTO `article` VALUES (7, 'Java企业级支付全家桶设计与实战', 'Java支付全家桶：企业级各类支付手段一站式解决方案 免费赠送：企业微信支付资质和支付账号,学真正的企业级支付！', '支付是企业实现生产价值最关键的一环，从事支付一定是企业核心业务。而无论何种销售形式，都离不开最关键的 “支付”环节。本课程带你实战实战移动端、PC端、H5等多终端的支付系统，本系统可对接各类真实业务系统，如外卖、电商、订票等各行业的业务系统，，为系统对接上支持微信、支付宝、银联、融合支付、混合支付等多种企业级支付模式，让你的系统一键支持【支付】功能。无论你是前端还是后端，只要你自认为是力争上游的后浪一员，都应该尽早攻克支付技术。', 'data:image/png;base64,', '2020-06-24 10:43:51');
INSERT INTO `article` VALUES (8, '构建完整JVM知识体系', '理论+实战 构建完整JVM知识体系 关于JVM的问题，在这里，通通解决', '对于Java开发而言，Java虚拟机是开发工作中必须要理解和掌握的知识内容，也是Java面试中面试官常会问到的考点。在本课程中，我将带你循序渐进的学习JVM：从源码到运行、类加载，再到内存分配和垃圾回收，以及JVM调优的技巧与实战。整个课程基于JDK13讲解，理论-实战-面试三结合，带你剖析整个JVM知识体系，JVM问题一站解决。', 'data:image/jpeg;base64,', '2020-06-24 10:44:35');
INSERT INTO `article` VALUES (9, '企业级Go改造PHP项目', '全站首门项目/产品重构迭代课，掌握企业级项目改造解决方案，精讲大厂项目踩坑避坑点，助你接轨企业', '互联网早期为快速上线，不少网站基于PHP构建，如：阿里的优酷网、Google的YouTube等，但随业务发展，出现性能等问题。当下，5G激发视频行业发展，故本课以 “优酷网”为蓝本 ，先基于PHP构建“慕优酷网”， 后进行Go改造。捞干讲：课程赠送从0到1的PHP源码。核心是：精讲从1到N的Go改造踩坑避坑点。', 'data:image/jpeg;base64,', '2020-06-24 10:47:03');

